import { Link } from 'react-router-dom'
import favicon from './favicon.png'
const Navbar = () => {
    return ( 
        <nav className = "navbar">
            <h1>Fresherstrip</h1>
            <div className = "links">
                <img src = {favicon} width = "50" alt = "logo" /> 
                <Link to = "/">Home</Link>
                <Link to = "/AboutUs">About Us</Link>
            </div>
        </nav>
    );
}
 
export default Navbar;
